  return (
    <ul className="pagination">
      <li className="page-item page-link" onClick={()=>{props.setCurrentPage(current_page-1)}}>{'<'} Prev</li>
      <li className="page-item page-link" onClick={()=>{props.setCurrentPage(current_page+1)}}>Next {'>'}</li>
    </ul>
  )
}

